def converti_cadena_en_array(cadena):
    arr = []
    dato = ""
    for i in range(len(cadena)):
        if(cadena[i] == "\n"):
            continue
        if(cadena[i] == ','):
            arr.append(float(dato)) 
            dato = ""
        else:
            dato += cadena[i]
    return arr





